  return (
    <BackgroundContainer>
      <GlassForm>
        <TitleBar>
          <Title>Login</Title>
          <CloseButton onClick={() => navigate('/menu')}>X</CloseButton>
        </TitleBar>
        <FormBody>
          <form>
            <input type="email" placeholder="Email" />
            <input type="password" placeholder="Senha" />
            <button type="submit">Entrar</button>
          </form>
          <ForgotPassword onClick={() => alert('Funcionalidade futura ðŸ™‚')}>
            Esqueceu a senha?
          </ForgotPassword>
        </FormBody>
      </GlassForm>
    </BackgroundContainer>
  );
}

